var tipuesearch = {"pages":[{"tags":"misc","text":"2016Fall 修課成員網誌","url":"./pages/about/","title":"About"},{"tags":"Misc","text":"第一週 今天剛開學 好開心哦!!!","url":"./2016fall-20160916-week1.html","title":"2016Fall 2016/09/16 Week1"},{"tags":"Misc","text":"Auth40423150 第二週 1.先到 https://github.com/mdecourse 的 2016cadp 按 Fork 2.在自己的github帳號創立一個 2016fallcadp_hw倉儲 把最下面的 Add.gitignore輸入 Python Add a license輸入 Agpl 3.在 2016fallcadp_hw倉儲 建立gh-pages分支 4.按上方的一個setting-branches-選擇gh-pages 5.在系上的電腦 輸入 140.130.17.17/2016fall 下載近端的python 6.在自己的帳號建立 40423126.github.io 說明打 my home page 把最下面的 Add.gitignore輸入 Python Add a license輸入 Agpl 7.在 40423126.github.io倉儲的左上角有一個 Create new file點進去 新增40423126.github.io.index.html 就會有自己的網頁了 8.進入 https://github.com/mdecourse/2016fallcadp/wiki 的上課筆記 下載繪圖軟體練習零件繪製: http://solvespace.com/bracket.pl","url":"./2016fall-20160923-week2.html","title":"2016Fall 2016/09/23 Week2"},{"tags":"Misc","text":"Auth40423150 第三週 打開網頁 到LAN設定 更改網路位址 proxy.mde.tw 連接:3128 即可連至學校網路","url":"./2016fall-20160930-week3.html","title":"2016Fall 2016/09/30 Week3"},{"tags":"Misc","text":"Auth40423150 第四週 2016.10.06 NOTE 1.先到 https://github.com/mdecourse 的 2016cadp 按 Fork 2.在自己的github帳號創立一個 2016fallcadp_hw倉儲 把最下面的 Add.gitignore輸入 Python Add a license輸入 Agpl 3.在 2016fallcadp_hw倉儲 建立gh-pages分支 4.按上方的一個setting-branches-選擇gh-pages 5.在系上的電腦 輸入 140.130.17.17/2016fall 下載近端的python 6.在自己的帳號建立 40423126.github.io 說明打 my home page 把最下面的 Add.gitignore輸入 Python Add a license輸入 Agpl 7.在 40423126.github.io倉儲的左上角有一個 Create new file點進去 新增40423126.github.io.index.html 就會有自己的網頁了 8.進入 https://github.com/mdecourse/2016fallcadp/wiki 的上課筆記 下載繪圖軟體練習零件繪製: http://solvespace.com/bracket.pl","url":"./2016fall-20161007-week4.html","title":"2016Fall 2016/10/07 Week4"},{"tags":"Misc","text":"Auth40423150 第五週 1.試著使用子模組來編輯 假設有人希望 git clone 帶有子模組的倉儲, 他必須在 git clone 後執行 git submodule init, 開啟子模組, 然後利用 git submodule update 抓取下子模組中的對應版本資料 對應版本紀錄在 .git/modules/g100/refs/heads/master 檔案裡 2.假如帶有子模組的倉儲管理者, 希望更新某一特定子模組的對應版本, 則必須先確定倉儲分支 然後用cd指令退回到子模組目錄中, 再用 git pull拉下來, 然後回到上層倉儲做版本的推送 假如想拉回所有子模組的對應版本內容, 要使用 git pull origin gh-pages --recurse-submodules, 又或著是想拉回 master 分支, 則使用 git pull origin master --recurse-submodules 註:如果要把所有子模組的對應版本更新到最新的提交, 使用 git submodule foreach \"(git checkout gh-pages; git pull)&\" 3.用前面的指令完成更新子模組的對應版本後, 要做推送資料, 將改版資料推到遠端, 之後透過 git submodule update --init --recursive 把此對應版本的子模組拉到近端, 其中因為子模組中還有子模組, 而此更新對這些新加入的子子模組沒有 --init, 所以子模組更新時, 要納入 --init","url":"./2016fall-20161014-week5.html","title":"2016Fall 2016/10/14 Week5"},{"tags":"Misc","text":"Auth40423150 第六週 用onshape跟Solvespace來畫指定的圖 Onshape部分: 用學校信箱帳號創立一個免費的Onshape帳號 Solvespace部分: 去課程倉儲的上課筆記下載Solvespace","url":"./2016fall-20161021-week6.html","title":"2016Fall 2016/10/21 Week6"},{"tags":"Misc","text":"Auth40423150 第七周 練習四連桿機構繪畫,熟悉Solvespace的使用方式 可以大概了解Solvespace的作畫模式,但是在畫的過程中經常運算錯誤,調整限制條件有點麻煩","url":"./2016fall-20161028-week7.html","title":"2016Fall 2016/10/28 Week7"},{"tags":"Misc","text":"Auth40423150 asd 段考周哦~~~~~","url":"./2016fall-20161104-week8.html","title":"2016Fall 2016/11/04 Week8"},{"tags":"Misc","text":"Auth40423150 第九周 自我評分,在上課得時候給自己打分數","url":"./2016fall-20161111-week9.html","title":"2016Fall 2016/11/11 Week9"},{"tags":"Misc","text":"Auth40423150 第十周 操作四連桿機構的模擬狀況,並截圖還有錄製影片","url":"./2016fall-20161118week10.html","title":"2016Fall 2016/11/18Week10"},{"tags":"Misc","text":"Auth40423150 第十一周 Solvespace 1. Parts 2. Assembly 3. Linkages (fourbar & multilink) 4. Compiled & API ShareX 錄製操作過程影片, 也可以取畫面圖檔, png jpg 檔案差異, 可以利用 GIMP 編輯圖檔 stl 檔案操控: https://github.com/bsilvereagle/LeapSTL","url":"./2016fall-20161125-week11.html","title":"2016Fall 2016/11/25 Week11"},{"tags":"Misc","text":"Auth40423150 第十二周 用Solvespace畫出挖洞的塊狀及棒狀配合件,並組合再一起","url":"./2016fall-20161202-week12.html","title":"2016Fall 2016/12/02 Week12"},{"tags":"Misc","text":"Auth40423150 把上禮拜組合好的部件圖檔slvs轉換成html網頁格式,放到個人網誌上","url":"./2016fall-20161209-week13.html","title":"2016Fall 2016/12/09 Week13"},{"tags":"Misc","text":"Auth40423150 jkloo Week14 了解另外的四連桿機構,由線架構來得知運動路徑","url":"./2016fall-20161216-week14.html","title":"2016Fall 2016/12/16 Week14"},{"tags":"Misc","text":"Auth40423150 bnm Week15 試著用Solvespace和OnShape來組立3D Delta Printer","url":"./2016fall-20161223-week15.html","title":"2016Fall 2016/12/23 Week15"},{"tags":"Misc","text":"Auth40423150 bnm 用OnShape畫出課程指定的連桿機構零件,在限制各部位的條件 P2 OnShape小組繪圖測試 from 40423248 on Vimeo .","url":"./2016fall-20161230-week16.html","title":"2016Fall 2016/12/30 Week16"},{"tags":"Misc","text":"Auth40423150 bnm 老師解說V-rep的功能和公司背景,還有檢查每個人的作業","url":"./2016fall-20170106week17.html","title":"2016Fall 2017/01/06Week17"},{"tags":"Misc","text":"Auth40423150 ert Week18 在這門課要學的有 1. 創造力三元素: 是對於自學,程式,想像等三種能力的結合,在課程中或是課外所學的東西及自己的想法用程式來表達 6種表達方式: 主要是集合成影片的方式來解說每一週學到的東西,用影音,圖片來表達 可攜式 Python3 程式環境: 用minifallana放在隨身碟裡在電腦中建立可攜式環境,到任何地方都可以編輯 Solvespace 參數 3D 繪圖系統: 繪畫出基本的3D零件及互相配合,但是不能做太複雜的組件,運算會出現錯誤 Onshape 雲端參數 3D 繪圖系統: 用即時的網路雲端繪圖軟體來做課程範例的繪圖,還有小組的作業繪製,包含Onshape Tutorial,Delta 3D Printer,Fourbar Linkage,Nutcracker ShareX 取畫面圖像與操作影片錄製: 這個軟體可以錄製螢幕畫面及螢幕截圖,但是有一定的機率出問題,原因不明,強制結合雲端的功能不是很方便 Github submodule 網際協同 (納入協同產品設計實習課程範圍)","url":"./2016fall-20170113-week18-dian-nao-fu-zhu-she-ji-shi-xi-ke-cheng-di-shi-ba-zhou-qi-mo-ke-cheng-zong-jie.html","title":"2016Fall 2017/01/13 Week18 電腦輔助設計實習課程第十八週期末課程總結"}]};